import React from 'react';
import { Route, Redirect } from 'react-router-dom';
import { Routes } from 'models';
import {
  LoginPage,
  RegisterPage,
  JobListPage,
  EmployerJobsPage,
  CandidatesPage,
  EmployerStagePage,
  JobDetail,
} from 'pages';
import { EmployeeOverview } from 'pages';
const auth =
  //  Boolean(
  //   localStorage.getItem('accessToken') && localStorage.getItem('refreshToken'),
  // );
  true;
export const PrivateRoute = ({ component: Component, ...rest }: any) => (
  <Route
    {...rest}
    render={props => (auth ? <Component {...props} /> : <Redirect to='/' />)}
  />
);

export const PrivateRoutes: Routes[] = [
  { path: '/dashboard', component: EmployerJobsPage, exact: true },
  { path: '/candidates', component: CandidatesPage, exact: false },
  { path: '/stage', component: EmployerStagePage, exact: false },
  { path: '/EmployerOverview', component: EmployeeOverview, exact: false },
];
